window.bookSummaryJSON = "<p><b>A small-town Christmas novella by the New York Times bestselling author of LAKEFRONT BILLIONAIRES series that will make you want to pack your bags and spend the holiday in Lake Wisteria. </b><br> <br> Catalina<br> Playing the part of my sister’s maid of honor is easy even if she’s marrying my ex.<br> But playing <i>nice</i> with the best man? An impossible task given our history.<br> Sure, Luke Darling may be suspiciously kind, incredibly handsome, and stubborn to a fault, but regardless of how hard he tries to make me see otherwise, I’m not interested. <br> It’s on me to remind him that he’s my ex-boyfriend’s best friend.<br> And the one I’m secretly starting to wish I met first.<br> <br> Luke<br> My job as the best man is a simple one, except for one minor issue.<br> I’ve spent so much time avoiding my best friend’s ex that I didn’t consider what could happen if I started craving Catalina Martinez’s company instead.<br> She is only in Lake Wisteria for the winter wedding, but her January departure date won’t stop me from pursuing her.<br> Getting her to date me would be nothing short of a Christmas miracle, but I’m determined to make her mine.<br> ‘Tis the season to fall in love…even if I’m the only one taking the risk. <br> <br> <i>My December Darling is a 50,000-word, Christmas-themed romance between a grumpy maid of honor and an outgoing best man who chases after what he wants.</i></p>"; 
